edy the situation either by means of solving the defect or substitute delivery.<br />\n<br />\n9.5 In the event of any failure of the Application to conform to any applicable warranty, You may notify the App-Store-Operator, and Your Application purchase price will be refunded to You. To the maximum extent permitted by applicable law, the App-Store-Operator will have no other warranty obligation whatsoever with respect to the App, and any other losses, claims, damages, liabilities, expenses and costs attributable to any negligence to adhere to any warranty.<br />\n<br />\n9.6 If the user is an entrepreneur, any claim based on faults expires after a statutory period of limitation amounting to twelve (12) months after the Application was made available to the user. The statutory periods of limitation given by law apply for users who are consumers.</p>\n\n<p>10. PRODUCT CLAIMS</p>\n\n<p>tyt, LLC and the End-User acknowledge that tyt, LLC, and not Apple, is responsible for addressing any claims of the End-User or any third party relating to the licensed Application or the End-User&rsquo;s possession and/or use of that licensed Application, including, but not limited to:<br />\n<br />\n(i) product liability claims;<br />\n<br />\n(ii) any claim that the licensed Application fails to conform to any applicable legal or regulatory requirement; and<br />\n<br />\n(iii) claims arising under consumer protection, privacy, or similar legislation, including in connection with Your Licensed Application&rsquo;s use.</p>\n\n<p>11. LEGAL COMPLIANCE</p>\n\n<p>You represent and warrant that You are not located in a country that is subject to a U.S. Government embargo, or that has been designated by the U.S. Government as a &quot;terrorist supporting&quot; country; and that You are not listed on any U.S. Government list of prohibited or restricted parties.</p>\n\n<p>12. CONTACT INFORMATION</p>\n\n<p>For general inquiries, complaints, questions or claims concerning the licensed Application, please contact:<br />\n<br />\n<strong>tyt, LLC<br />\n6255 Towncenter Drive Ste 819<br />\nClemmons, NC 27012<br />\nUnited States<br />\nsupport@tyt.us </strong></p>\n\n<p>13. TERMINATION</p>\n\n<p>The license is valid until terminated by tyt, LLC or by You. Your rights under this license will terminate automatically and without notice from tyt, LLC if You fail to adhere to any term(s) of this license. Upon License termination, You shall stop all use of the Application, and destroy all copies, full or partial, of the Application.</p>\n\n<p>14. THIRD-PARTY TERMS OF AGREEMENTS AND BENEFICIARY</p>\n\n<p>tyt, LLC represents and warrants that tyt, LLC will comply with applicable third-party terms of agreement when using licensed Application.<br />\n<br />\nIn Accordance with Section 9 of the &quot;Instructions for Minimum Terms of Developer&#39;s End-User License Agreement,&quot; Apple and Apple&#39;s subsidiaries shall be third-party beneficiaries of this End User License Agreement and - upon Your acceptance of the terms and conditions of this license agreement, Apple will have the right (and will be deemed to have accepted the right) to enforce this End User License Agreement against You as a third-party beneficiary thereof.</p>\n\n<p>15. INTELLECTUAL PROPERTY RIGHTS</p>\n\n<p>tyt, LLC and the End-User acknowledge that, in the event of any third-party claim that the licensed Application or the End-User&#39;s possession and use of that licensed Application infringes on the third party&#39;s intellectual property rights, tyt, LLC, and not Apple, will be solely responsible for the investigation, defense, settlement and discharge or any such intellectual property infringement claims.</p>\n\n<p>16. APPLICABLE LAW</p>\n\n<p>This license agreement is governed by the laws of the State of North Carolina excluding its conflicts of law rules.</p>\n\n<p>17. MISCELLANEOUS</p>\n\n<p>17.1 If any of the terms of this agreement should be or become invalid, the validity of the remaining provisions shall not be affected. Invalid terms will be replaced by valid ones formulated in a way that will achieve the primary purpose.<br />\n<br />\n17.2 Collateral agreements, changes and amendments are only valid if laid down in writing. The preceding clause can only be waived in writing.</p>', 'xo6KnllBLUnJgI5fmRUxls8XepKjgA42fAXnbsdx.jpg', '<h2>What you will need to apply with us</h2>\n\n<ul>\n<li>You must have a valid driver&rsquo;s license - Temporary or out-of-state licenses are also acceptable.</li>\n<li>You must be 25 years or older to drive.</li>\n<li>You must have a clean driving record with auto insurance.</li>\n<li>You consent to our driver screening and background check.</li>\n<li>You must own an iPhone or Android smartphone that can download and run the tyt Driver app.</li>\n</ul>', 'jVaKZ7cmFBp1uAuvjgn5sjxpeOEgSmMw8zduGTaf.jpg', '<h2>Vehicle Requirements</h2>\n\n<ul>\n<li>2008 or newer**</li>\n<li>4 doors</li>\n<li>5-8 seats, including the driver&rsquo;s</li>\n<li>North Carolina plates</li>\n<li><strong>**Car year may vary by region </strong></li>\n</ul>', '1RexFkyPOi1BErCFKU8uYwMm9mL5VzuysTWRaxaJ.jpg', '<h3>Document requirements</h3>\n\n<ul>\n<li>Driver profile photo</li>\n<li>Vehicle registration</li>\n<li>Personal vehicle insurance</li>\n<li>North Carolina vehicle inspection</li>\n</ul>', '9z3dVmaWgwUAtOQv4neyEfu5Oe58IZYfdfsCY5ZA.jpg', '<h1><strong>Download the Driver Luxury Limoexpress&nbsp;app Today</strong></h1>', '<p><strong>Good things happen when people can move, whether across town or toward their dreams. Opportunities </strong></p>\r\n\r\n<p><strong>appear, open up, become reality.</strong></p>', '<h1><strong>Be your own boss</strong></h1>\r\n\r\n<h3>Hours are completely flexible. Drive mornings, evenings, weekdays, or weekends.</h3>', 'pOzcct0XNSuOSmSuWTDfP8ePmLMhZliODdQFwWTX.svg', '<h2><strong>Download</strong></h2>', '<p>Download the Tagxi Driver App from the Google Play or App Store on your smartphone.</p>', '5rNx2yDAFIbo90GugqyGWQ7UdpU9s0HPIDpZVmH2.svg', '<h2><strong>Upload</strong></h2>', '<p>Upload your driver required documents in the app. Get Approved</p>', 'OPx6uFwmzO5u99oNFgB9zXPRMkskpD491gmqPTAQ.svg', '<h2><strong>Drive!</strong></h2>', '<p>Drive and earn as much as you want. Get paid weekly for the time and distance of a trip plus tips.</p>', '<h2><strong>Why Drive with Tagxi</strong></h2>', '<p><strong>About us</strong></p>', 'CkXGI95QRqqefSia0gxn3CVeHxiALzoZgWFbaOJO.png', '<p>Tagxi is a rideshare platform facilitating peer to peer ridesharing by means of connecting passengers who are in need of rides from drivers with available cars to get from point A to point B with the press of a button. tyt is a clever 4 letter word that sounds like &quot;easy&quot; a fantastic connotation of effortless ease and accessibility to get you to your destination. tyt welcomes applicants year-round - summer, winter, fall, spring, and holiday work seekers.</p>', '<p>Our Mission</p>', 'wxZlB9jU3D51XbnxyhbeQMFXqNLgyHMUKIJ2WXx4.png', '<p>It&rsquo;s our goal to create a flexible working environment that is inclusive and reflects the diversity of the cities we serve&mdash;where everyone can be their authentic self, and where that authenticity is celebrated as a strength. By creating an environment where people from every background can thrive, we&rsquo;ll make tyt a better company&mdash;for our drivers and our customers.</p>', '<p>Driver Commitment</p>', 'laHGbcRZ8YbrFYXQcWq1HebYW4HhdnuvTOtD3CKH.png', '<p>We promise to provide the technology and the support needed to empower you to be your own boss, deciding on when and how often you drive. Let us take you places. Through our software, we take the guesswork and hassle out of securing your fare. We will always seek to apply technological advancements to the current process in order that the driver is fully equipped to operate in the given climate.</p>', 'J47s4D1AxvdoB7YWbARxCpEexbT1puAR8NVHRUgr.jpg', 'JIaEaUVL7Q5BpRHwxL3KbclM44BcYmsyIXvDdL7i.png', '<p><strong>Download the Driver App</strong></p>', '<p><strong>Real-Time ETA Prediction</strong></p>', '<p><strong>Customer Referral</strong></p>', '<p><strong>In-App Chat</strong></p>', '<p><strong>Emergency SOS Button</strong></p>', 'PNAhDhAI8UxQ21JUDxkm0ZAoRwjSMStz8Amg41aU.jpg', '<h3>Get the app</h3>', 'yJp1Givor2pcQZjmKHpwVObJPlN8gGFonIyM3bOy.png', '<p>Get the app on Apple App Store or Google Play</p>', '<p>You can complete the application in the tyt Driver App</p>', '8EmDtFUTSOfgNddshqJksMDaKdjhdljkQtocoUXJ.png', '<h3>Apply to drive</h3>', '<h3>Get Approved</h3>', '1v9jBpYjpsBxP0krKKN4eo16nGqotzQbCOViIEWV.png', '<p>After uploading your required documents and passing the background checks, you&rsquo;re ready to hit the road and start earning.</p>', '<p>Open the app and turn on driver mode</p>', 'LJPfXEJzwSDoebFVLyG3ye02Eu1EmUNdM2LzmdSA.png', '<p>Open the app</p>', '<h3>Accept a passenger</h3>', '4xTQJVd9MJSQiQgsPrkxmWco5lfnKgPMTa0oS9Iu.png', '<p>Accept a passenger ride request</p>', '<p>Pick up your passenger at their location</p>', 'vzgfJTndfgLAHJZToPd2LgJ8NSshNW5jR3yasY52.png', '<h3>Pick up</h3>', '<h3>Drop off</h3>', 'SH4JqHAeVXj9Mkz78giGIjxGqyob02kpjMk1fhFq.png', '<p>Drop off your passenger at their destination</p>', '0000-00-00', '2025-03-17', 'INAO5d4sUN0rFwuobaHoRVwiof9c5So89YaxnaND.jpg', '<p>Get In Touch With Us</p>\r\n\r\n<p>Have a question, inquiry or comment? Feel free to contact us. Simply fill in the contact form or just select your preferred channel and send us a message. We&rsquo;ll do everything we can to respond quickly.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Address: </strong><br />\r\nBhiringi Durgapur, pin 713213</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Email: </strong><br />\r\nMedia Inquiries: <a href=\"mailto:media@tyt.us\">media@tyt.us</a><br />\r\nPartnership Inquiries: <a href=\"mailto:partner@tyt.us\"> partner@tyt.us</a><br />\r\nFile a complaint: <a href=\"mailto:compliance@tyt.us\"> compliance@tyt.us</a><br />\r\nGeneral Inquiries: <a href=\"mailto:info@tyt.us\"> info@tyt.us</a></p>', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d7314.88591205033!2d87.2714417621879!3d23.552529549964223!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x39f76d899c01341d%3A0x541f90f022a7f613!2sBhiringi%2C%20Benachity%2C%20Durgapur%2C%20West%20Bengal%20713213!5e0!3m2!1sen!2sin!4v1730090549405!5m2!1sen!2sin\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', '', '', '', '', '#b78700', '#111111', '#111111', '#5cd7b1', '#111111', '#31c1df', '#4f4f4f', NULL, NULL, NULL, NULL, NULL, NULL, 'JglbLSRwfvppuzE8m85O8dNBIxRIFp42AH6YzYW3.png', 'https://patnasanitaryemporium.com/luxury/public/privacy', 'https://patnasanitaryemporium.com/luxury/public/terms', 'luxurylimoexpres@gmail.com');
