INSERT INTO `mail_templates` (`id`, `mail_type`, `description`, `active`, `created_at`, `updated_at`) VALUES
('37076ccc-c73b-4056-af49-ec4f32d34963', 'welcome_mail', '<p>Dear $user_name,</p>\n\n<p>Welcome to Luxury Limoexpress! We’re excited to have you on board and ready to offer you a safe, comfortable, and reliable ride experience.</p>\n\n<p>Our professional drivers are available around the clock to get you to your destination safely and on time—without any hassle. Whether it’s a short trip or a longer journey, Luxury Limoexpress ensures top-notch service at fair prices.</p>\n\n<p>As a welcome gift, we’re giving you a promo code for your first ride:</p>\n\n<p>🎁 Code: <strong>WELCOME25</strong> </p>\n<p>(Get 25%off on your first ride)</p>\n\n<p>Simply enter the code at checkout in the app and enjoy your first ride with Luxury Limoexpress!</p>\n\n<p>If you have any questions or need assistance, our support team is always here to help.</p>\n\n<p>We look forward to serving you!</p>\n\n<p>Best regards</p>\n\n<p>Luxury Limoexpress Team</p>', 1, '2024-10-27 17:11:37', '2024-10-27 17:11:37'),
('75a350d7-2dc0-46f8-886b-87c84afda0fd', 'welcome_mail_driver', '<p>Dear $user_name,</p>\n\n        <p>Congratulations on becoming a newly registered driver! We are excited to welcome you to the world of driving and wanted to take a moment to extend our warmest greetings.</p>\n\n        <p>As a registered driver, you now have the opportunity to explore new destinations, embrace independence, and experience the joys of the open road. We hope this new chapter brings you many memorable adventures and experiences.</p>\n\n        <p>Please remember to prioritize safety as you embark on your driving journey. Observe traffic laws, wear your seatbelt, and remain attentive at all times. Safe driving not only protects you but also ensures the well-being of others around you.</p>\n\n        <p>If you ever have any questions or need assistance along the way, our team is here to support you. Don&#39;t hesitate to reach out to us; we&#39;re more than happy to help.</p>\n\n        <p>Once again, congratulations on your registration! Enjoy the freedom and excitement that driving offers. We wish you safe travels and an incredible journey ahead.</p>\n\n        <p>Best regards,</p>\n\n        <p>Tagxi</p>', 1, '2024-10-27 17:11:37', '2024-10-27 17:11:37');
